import React from 'react';
import '../../App.css';
import './About.css'


export default function About() {
  return (
    <>
      <h1 className='about'>ABOUT</h1>
      <h2 className='tBox'>The CSS box model is essentially a 
      box that wraps around every HTML element. 
      It consists of: borders, padding, margins, and the 
      actual content</h2>
    </>
    );
}
